export function searchProducts(query, limit = 8) {
  const searchTerm = query.toLowerCase();
  return GROCERY_PRODUCTS.filter(product => product.name.toLowerCase().includes(searchTerm) || product.description.toLowerCase().includes(searchTerm) || product.brand && product.brand.toLowerCase().includes(searchTerm)).slice(0, limit);
}
